import React from "react";
import Button from "../../common/Button/Button";

const CalWrapper = (props) => {
  const allButton = props.allBtArr.map((btObj) => {
    return <Button btName={btObj.value} btFun={btObj.btFun} />; //component
  });

  const allOperationBtn = props.operatonArr.map((btObj) => {
    return <Button btName={btObj.value} btFun={btObj.btFun} />;
  });
  // console.log(allButton);
  return (
    <div className="main-">
      <div className="bt-name">{allButton}</div>
      <div className="opration-bt">{allOperationBtn}</div>
    </div>
  );
};

export default CalWrapper;
